В ходе видеомоста будут затронуты, в частности, вопросы реализации Соглашения о механизме прослеживаемости товаров, ввозимых на таможенную территорию Союза, а также Соглашения о применении в ЕАЭС навигационных пломб для отслеживания перевозок.
Видеомост запланирован в преддверии заседания Евразийского межправсовета, которое состоится 25 февраля в Нур-Султане.
На вопросы журналистов по актуальной повестке ответят:
- член Коллегии (министр) по таможенному сотрудничеству ЕЭК Максат Мамытканов;
- директор Департамента таможенного законодательства и правоприменительной практики ЕЭК Сергей Владимиров;
- директор Департамента трудовой миграции и социальной защиты ЕЭК Алтынай Омурбекова.
